import React from 'react';
import fetchCambio from '../fetch/fetchCambio';

class Wallet extends React.Component {
  constructor() {
    super();
    this.state = {
      cambios: [],
    };

    this.catchCambio = this.catchCambio.bind(this);
  }

  async componentDidMount() {
    await this.catchCambio();
  }

  async catchCambio() {
    const cambi = await fetchCambio();
    this.setState({
      cambios: cambi,
    });
  }

  render() {
    const { cambios } = this.state;
    return (cambios === [] ? (<div>Entre novamente no Login</div>) : (
      cambios.map((cambio, index) => (
        <ul key={ index }>
          <li>{cambio}</li>
        </ul>
      ))
    )
    );
  }
}

export default Wallet;
